import { React } from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      Trifid interactive map
      <link
        rel="stylesheet"
        href="http://aladin.u-strasbg.fr/AladinLite/api/v2/latest/aladin.min.css"
      />
      <script
        type="text/javascript"
        src="http://code.jquery.com/jquery-1.9.1.min.js"
        charset="utf-8"
      ></script>
      <div id="aladin-lite-div" style={{ width: "80%", height: "80%" }}></div>
      <script
        type="text/javascript"
        src="http://aladin.u-strasbg.fr/AladinLite/api/v2/latest/aladin.min.js"
        charset="utf-8"
      ></script>
    </div>
  );
}

export default App;
